import "./App.css";
import { useEffect, useState } from "react";
import axios from "axios";

function App() {
  const [BCBit1, setBCBit1] = useState("");
  const [BCBit2, setBCBit2] = useState("");
  const [BCEth1, setBCEth1] = useState("");
  const [BCEth2, setBCEth2] = useState("");
  useEffect(() => {
    const URL = "https://api.blockchain.com/v3/exchange/tickers/BTC-USD";
    const USER_TOKEN = "82e5aad3-967e-417c-9c6f-82a897b3a603";
    const AuthString = "Bearer ".concat(USER_TOKEN);
    axios
      .get(URL, { headers: { Authorization: AuthString } })
      .then((response) => {
        console.log(response.data);
        setBCBit1(response.data.last_trade_price);
      })
      .catch((error) => {
        console.log("error " + error);
      });
  }, []);
  useEffect(() => {
    const URL = "https://api.blockchain.com/v3/exchange/tickers/ETH-USD";
    const USER_TOKEN = "82e5aad3-967e-417c-9c6f-82a897b3a603";
    const AuthString = "Bearer ".concat(USER_TOKEN);
    axios
      .get(URL, { headers: { Authorization: AuthString } })
      .then((response) => {
        console.log(response.data);
        setBCEth1(response.data.last_trade_price);
      })
      .catch((error) => {
        console.log("error " + error);
      });
  }, []);
  useEffect(() => {
    const URL =
      "https://min-api.cryptocompare.com/data/price?fsym=BTC&tsyms=USD";
    const USER_TOKEN =
      "5a04c723bfb95037e838e1a32471f370b94da79354fb820070e789999aa9d78f";
    const AuthString = "Bearer ".concat(USER_TOKEN);
    axios
      .get(URL, { headers: { Authorization: AuthString } })
      .then((response) => {
        console.log(response.data);
        setBCBit2(response.data.USD);
      })
      .catch((error) => {
        console.log("error " + error);
      });
  }, []);
  useEffect(() => {
    const URL =
      "https://min-api.cryptocompare.com/data/price?fsym=ETH&tsyms=USD";
    const USER_TOKEN =
      "5a04c723bfb95037e838e1a32471f370b94da79354fb820070e789999aa9d78f";
    const AuthString = "Bearer ".concat(USER_TOKEN);
    axios
      .get(URL, { headers: { Authorization: AuthString } })
      .then((response) => {
        console.log(response.data);
        setBCEth2(response.data.USD);
      })
      .catch((error) => {
        console.log("error " + error);
      });
  }, []);
  return (
    <div>
      <h1>Stock Prices</h1>
      <button onClick={() => window.location.reload(false)}>
        Click to refresh prices!
      </button>
      <div>
        <p>Bitcoin Exchange 1:</p>
        <input type="text" name="price" defaultValue={BCBit1}></input>
      </div>
      <div>
        <p>Bitcoin Exchange 2:</p>
        <input type="text" name="price" defaultValue={BCBit2}></input>
      </div>
      <div>
        <p>Ethereum Exchange 1:</p>
        <input type="text" name="price" defaultValue={BCEth1}></input>
      </div>
      <div>
        <p>Ethereum Exchange 2:</p>
        <input type="text" name="price" defaultValue={BCEth2}></input>
      </div>
      <div>
        {BCBit1 > BCBit2 ? (
          <p>Buy Bitcoin on exchange 2.</p>
        ) : (
          <p>Buy Bitcoin on exchange 1.</p>
        )}
      </div>
      <div>
        {BCBit1 > BCBit2 ? (
          <p>Sell Bitcoin on exchange 1.</p>
        ) : (
          <p>Sell Bitcoin on exchange 2.</p>
        )}
      </div>
      <div>
        {BCEth1 > BCEth2 ? (
          <p>Buy Ethereum on exchange 2.</p>
        ) : (
          <p>Buy Ethereum on exchange 1.</p>
        )}
      </div>
    </div>
  );
}

export default App;
